    render(){   
        return (
            <li className="list-group-item d-flex align-tiems-center ">
                {this.label}
                <button className="btn ml-auto btn-outline-primary" onClick="">&#x2713;</button>
            </li>
        )//end return in render()
    }//end render()

}//end ToDoClass

